(1, 'Máy Hàn Miệng Túi Liên Tục Có Thổi Khí DBF-1000', '<p><span style=\"font-size:14px\">-&nbsp;&nbsp; &nbsp;Model: MHĐG-B06<br>\n-&nbsp;&nbsp; &nbsp;Điện nguồn: 220V/50 Hz<br>\n-&nbsp;&nbsp; &nbsp;Công suất: 540W<br>\n-&nbsp;&nbsp; &nbsp;Tốc độ dán: 0-16m/ phút<br>\n-&nbsp;&nbsp; &nbsp;Độ rộng mép dán: 6- 10 mm<br>\n-&nbsp;&nbsp; &nbsp;Độ dày màng dán: 0.02- 0.80 mm<br>\n-&nbsp;&nbsp; &nbsp;Nhiệt độ dán: 0- 300 độ C.<br>\n-&nbsp;&nbsp; &nbsp;Sức kéo của băng tải: ≤ 5kg<br>\n-&nbsp;&nbsp; &nbsp;Kích thuớc máy: (920 x 390 x 600) mm<br>\n-&nbsp;&nbsp; &nbsp;Trọng lượng máy: 41 kg<br>\n-&nbsp;&nbsp; &nbsp;Bảo hành: 12 tháng</span></p>', '<div class=\"section_cvp_title margin-b-15\">\n                                                    \n                                                </div>\n                                                <div class=\"tinymce\">\n                                                    <p dir=\"ltr\">Trên thị trường hiện nay xuất hiện những chiếc máy có chức năng hàn miệng túi với rất nhiều mẫu mà phổ biến. Vì vậy hôm nay công ty chúng tôi xin giới thiệu đến quý khách hàng dòng sản phẩm máy hàn miệng túi liên tục có thổi khí DBF-1000 đạt chuẩn quốc tế.</p>\n\n<p dir=\"ltr\" style=\"text-align:center\"><img alt=\"Máy hàn miệng túi liên tục có thổi khí DBF-1000\" src=\"data:image/png;base64,', '[\"UploadImage\\/may-han-mieng-tui-dbf-1000.jpg\"]', 0, 0, 'MHĐG-B06                      ');
INSERT INTO `product` (`id`, `name`, `des`, `note`, `image`, `price`, `price_sale`, `product_code`) VALUES
(2, 'Staub - Nồi Tròn Màu Xám #24cm', '', '<div class=\"rte product_getcontent\">\n\n\n\n\n\n\n<p><u><strong>Mô tả:</strong></u></p>\n<p style=\"text-align: justify;\">Nồi mang đến cho bạn những trải nghiệm tuyệt vời khi chế biến các món ninh, hầm, áp chảo.</p>\n<p style=\"text-align: justify;\">Thiết kế sang trọng, đẹp mắt, nổi bật khi sử dụng để trưng bày trên bàn ăn.</p>\n<p style=\"text-align: justify;\">Bên trong nồi được phủ lớp men đen, giúp hạn chế trầy xước và món ăn trở nên đẹp mắt hơn.</p>\n<p style=\"text-align: justify;\">Bên ngoài được phủ men thuỷ tinh, đảm bảo bền màu, hạn chế trầy xước.</p>\n<p style=\"text-align: justify;\">Núm nắp nồi được làm bằng niken với khả năng chịu nhiệt lên tới 250 độ C.</p>\n<p style=\"text-align: justify;\">Sử dụng được trên mọi loại bếp, kể cả bếp từ.</p>\n<p style=\"text-align: justify;\">Có thể vệ sinh bằng máy rửa chén.</p>\n<p>Thương hiệu: Staub.</p>\n<p>Sản xuất tại Pháp.</p>\n<p>Bảo hành 5 năm.</p>\n<p>Chất liệu: gang.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<strong>Nồi gang tròn màu xám</strong>&nbsp;là sản phẩm của thương hiệu STAUB đến từ Pháp.\n<ul style=\"margin-left: 50px; line-height: 2\">\n<li style=\"text-align: justify;\"><strong>Nồi gang Staub</strong> được sản xuất hoàn toàn tại Pháp.</li>\n<li style=\"text-align: justify;\">Thiết kế sang trọng, đẹp mắt, nổi bật khi sử dụng để trưng bày trên bàn ăn.</li>\n<li style=\"text-align: justify;\">Bên trong nồi được phủ lớp men đen, giúp hạn chế trầy xước và món ăn trở nên đẹp mắt hơn.</li>\n<li style=\"text-align: justify;\">Bên ngoài được phủ men thuỷ tinh, đảm bảo bền màu, hạn chế trầy xước.</li>\n<li style=\"text-align: justify;\">Núm nắp nồi được làm bằng niken với khả năng chịu nhiệt lên tới 250 độ C.</li>\n<li style=\"text-align: justify;\">Sử dụng được trên mọi loại bếp, kể cả bếp từ.</li>\n<li style=\"text-align: justify;\">Sản phẩm có các màu: vàng, đen, đỏ cherry, xám, xanh rêu, nâu vàng, đỏ lựu, đỏ cherry, xám, đen, xanh đen, xanh nhạt, nấm trắng, kem, xanh ô liu.</li></ul>\n<p style=\"text-align:center;\"><img alt=\"Nồi gang tròn staub\" src=\"https://res.cloudinary.com/webb-kitchenkoncept/image/upload/v1623158892/ezgif-2-dc3c601fc098_hib80c.webp\"></p>\n<p>Nắp nồi được thiết kế đặc biệt, giúp hơi nước được đối lưu liên tục, cùng tất cả hương vị tuyệt vời của món ăn được giữ lại bên trong nồi. Hơi nước&nbsp;ngưng tụ ở nắp nồi,&nbsp;rơi nhỏ giọt xuống và phân bổ đều vào thức ăn, quá trình này giúp&nbsp;việc nấu ăn hiệu quả <strong>hơn 9 lần</strong> và giữ độ ẩm luôn<strong> cao hơn 20%</strong> so với các sản phẩm thông thường, giúp món ăn chín đều mềm mọng mà không bị khô.</p>\n<p style=\"text-align: center\"><img alt=\"Hiệu ứng aroma rain\" src=\"https://res.cloudinary.com/kitchen-koncept/image/upload/v1634795708/samples/Hi%E1%BB%87u_%E1%BB%A9ng_aroma_rain_sijccj.gif\"></p>\n<p><u><strong>Thông tin kích thước:</strong></u></p>\n<ul style=\"margin-left: 50px; line-height: 2\">\n<li>Nồi có các kích thước: 10cm, 16cm, 18cm, 20cm, 22cm, 24cm, 26cm.</li></ul>\n<p><u><strong>Hướng dẫn:</strong></u></p>\n<p>Sử dụng:</p>\n<ul style=\"margin-left: 50px; line-height: 2\">\n<li>Chuyên dùng để nướng bánh, đựng sốt hoặc trưng bày trên bàn ăn.</li>\n<li>Sử được trên mọi loại bếp, kể cả bếp từ.</li></ul>\n<p><u><strong>Vệ sinh &amp; bảo quản:</strong></u></p>\n<ul style=\"margin-left: 50px; line-height: 2\">\n<li>Có thể vệ sinh bằng máy rửa chén. Khuyến khích rửa sản phẩm bằng tay.&nbsp;</li>\n<li>Dùng khăn mềm vệ sinh sản phẩm, không dùng đồ chà xoong.&nbsp;</li>\n<li>Bảo quản nơi khô ráo.</li></ul>\n<p>Tại Kitchen Koncept, chúng tôi cung cấp sản phẩm <strong>nồi tròn STAUB</strong> nhập khẩu chính hãng được kiểm định rõ ràng bởi các cơ quan chức năng. Mua hàng tại Kitchen Koncept khách hàng sẽ yên tâm khi nhận được đầy đủ chế độ bảo hành và dịch vụ hậu mãi chúng tôi đem đến.</p>\n</div>\n\n<div class=\"rte\">\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><u><strong>Sử Dụng:</strong></u></p>\n<p>Chuyên dùng để nướng bánh, đựng sốt hoặc trưng bày trên bàn ăn.</p>\n<p>Sử được trên mọi loại bếp, kể cả bếp từ.</p>\n<p><u><strong>Bảo Quản:</strong></u></p>\n<p>Có thể vệ sinh bằng máy rửa chén. Khuyến khích rửa sản phẩm bằng tay.&nbsp;</p>\n<p>Dùng khăn mềm vệ sinh sản phẩm, không dùng đồ chà xoong.&nbsp;</p>\n<p>Bảo quản nơi khô ráo.</p>\n\n\n\n\n\n\n\n\n\n\n</div>', '[\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/8c616000-a2c0-4ebf-bd71-f31d36debe94.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/1101018.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110101810cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110141814cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/untitled1a31c711ffd8b45509a287.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110161816cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110181818cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/11010182.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110201820cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110221822cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110241803.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110241824cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/110261826cm.jpg?v=1668506225027\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/3ec9aac0-6eac-4f1b-b0db-15a945987591.jpg?v=1668506225880\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/35245349-08f7-4bef-8e2d-11fbe561e713.jpg?v=1668506226947\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/dfd4ff19-846d-4dc6-be0c-8578365be34f.jpg?v=1668506228177\",\"\\/\\/bizweb.dktcdn.net\\/100\\/410\\/640\\/products\\/29a3415f-11d8-4e67-9c08-f0b9c1355421.jpg?v